import React from 'react';
import { BrowserRouter , Switch , Route } from 'react-router-dom';

// /////////////////////////////
import Header from './layout/header.component';

function App() {
  return (
    <div>
      <Header/>
      <BrowserRouter>
        <Switch>
          <Route exact path='' component=''></Route>
          <Route exact path='' component=''></Route>
          <Route exact path='' component=''></Route>
          <Route exact path='' component=''></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
